import '../Styles/loginpage.css'
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import AccountCircle from '@mui/icons-material/AccountCircle';
import Button from '@mui/material/Button';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import { useNavigate } from 'react-router-dom';
import { Container } from '@mui/material';
import { useState } from 'react';
function Loginpage(params) {
    const [name,setName]=useState("");
    let navigate=useNavigate();
    let handleSubmit = (event)=>{
        console.log("here");
        navigate('/posts',{state:{data:name}});
        event.preventDefault();
    }
    return(
        <div className='loginpage'>
            <AppBar sx={{mb:20}}>
                <Toolbar>
                    <Typography variant="h3" component="div">
                    Interact
                    </Typography>
                </Toolbar>
            </AppBar>
            <form onSubmit={handleSubmit}>
                <Container sx={{mt:12}}>
                    <Box sx={{ m: 1,margin:"auto",width:300 } }>
                        <Typography variant="h4" component="div">
                        Enter Details
                        </Typography>
                        <Box sx={{ display: 'flex', alignItems: 'flex-end'}}>
                            <AccountCircle sx={{ color: 'action.active', mr: 1, my: 0.5,fontSize:"4rem" }} />
                            <TextField id="input-with-sx" sx={{mb:2, width:200,resize:{fontSize:50} }} label="Enter your name" value={name} onChange={(e)=>{setName(e.target.value)}} size='medium' variant="standard" required={true}  />
                        </Box>
                        <Button sx={{width:150,m:"auto"}} type='submit'variant="contained">Continue</Button>
                    </Box>
                </Container>
                
            </form>
            
        </div>
    )
}
export default Loginpage
